const EventsPage = () => {
  fetch("https://pokeapi.co/api/v2/pokemon/bulbasaur")
    .then((response) => {
      if (!response.ok) {
        throw new Error();
      }
    })
    .then((data) => console.log(data))
    .catch((error) => console.log(error));
  return <h1>hello</h1>;
};

export default EventsPage;
